import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

function Profile(){
    return(
        <div>
            <Navbar/>
            <div className="container">
                <label> First Name:</label>
                <input placeholder="First Name"></input>
            </div>
            <Footer/>
        </div>
    )
    
}

export default Profile;
